INSERT INTO documents_editables (`documentId`,`name`,`type`,`data`) VALUES (136,'content:5.infoSummary','input','Unsere Mission ist den An- und Verkauf von Oldtimern für private Käufer und Verkäufer als auch Händler durch den Einsatz von exzellenten Tools zum Erlebnis zu machen. Wir sind ein lebendiger Demo-Marktplatz, der auf innovativer Spitzentechnologie aufbaut und sich ständig weiterentwickelt, um nicht nur den Bedürfnissen von Oldtimer-Enthusiasten gerecht zu werden. Zusätzlich bieten wir eine große Auswahl an Ersatzteilen für viele Marken und Modelle an.');
