INSERT INTO documents_editables (`documentId`,`name`,`type`,`data`) VALUES (140,'content:1.headline','input','61.569 Oldtimer Autos und Trucks zum Verkauf!');
INSERT INTO documents_editables (`documentId`,`name`,`type`,`data`) VALUES (140,'content:1.lead','wysiwyg','<p>Unsere Mission ist es, Händlern und Privatverkäufern ein außergewöhnliches Verkaufserlebnis und exzellente Werkzeuge für Menschen zu bieten, die daran interessiert sind, einen Oldtimer sicher online zu kaufen. Wir sind ein lebendiger Demo-Marktplatz, der auf innovativer Spitzentechnologie basiert und sich ständig weiterentwickelt, um nicht nur den Bedürfnissen von Oldtimer-Enthusiasten gerecht zu werden.</p>\n');
