INSERT INTO documents_editables (`documentId`,`name`,`type`,`data`) VALUES (140,'content:6.quote','input','Außergewöhnlicher Service! Das Support-Team hat sich von Anfang an um uns gekümmert und uns geholfen, unsere Angebote auf dem Marktplatz zu verbessern.');
INSERT INTO documents_editables (`documentId`,`name`,`type`,`data`) VALUES (140,'content:7.headline','input','100% Kundenzufriedenheitsgarantie');
INSERT INTO documents_editables (`documentId`,`name`,`type`,`data`) VALUES (140,'content:7.lead','wysiwyg','<p>Wir sind fest entschlossen, all unseren Kunden und Partnern den bestmöglichen Service zu bieten.<br />\nBitte lesen Sie, was unsere Händler, Privatverkäufer und Käufer über unseren Demo-Oldtimermarkt zu sagen haben.</p>\n');
